<p>
<strong><a id='p1'></a><h2>–õ—å–≤—ñ–≤—Å—å–∫–∞ —Å–≤–∞—Ö–∞ –¢–µ—Ç—è–Ω–∞ –†–∞–∫: ¬´7 —Ö–≤–∏–ª–∏–Ω ‚Äì –¥–æ—Å—Ç–∞—Ç–Ω—å–æ, —â–æ–± –∑–Ω–∞–π—Ç–∏ —Å–≤–æ—é –ø–∞—Ä—É¬ª</h2></strong><p>–°–ø—ñ–ª–∫—É—é—Ç—å—Å—è –ø–∞—Ä–∞–º–∏. –ß–µ—Ä–µ–∑ –∫–æ–∂–Ω—ñ 7 —Ö–≤–∏–ª–∏–Ω –º—É–∂—á–∏–Ω–∏ –ø–µ—Ä–µ—Å—ñ–¥–∞—é—Ç—å –∑–∞ –Ω–∞—Å—Ç—É–ø–Ω–∏–π —Å—Ç–æ–ª–∏–∫ –ø–æ –∫–æ–ª—É. –°–ø—ñ–ª–∫—É–≤–∞–Ω–Ω—è –≤—ñ–¥–±—É–≤–∞—î—Ç—å—Å—è –¥–æ —Ç–∏—Ö –ø—ñ—Ä, –ø–æ–∫–∏ –≤—Å—ñ —É—á–∞—Å–Ω–∏–∫–∏ –ø–æ–±–∞—á–µ–Ω–Ω—è –Ω–µ –ø–æ–≥–æ–≤–æ—Ä—è—Ç—å –æ–¥–∏–Ω –∑ –æ–¥–Ω–∏–º. –£ –∫–æ–∂–Ω–æ–≥–æ —î –∫–∞—Ä—Ç–∞ —Å–∏–º–ø–∞—Ç—ñ–π, —É –Ω—ñ–π —É—á–∞—Å–Ω–∏–∫–∏ –≤—ñ–¥–º—ñ—á–∞—é—Ç—å —Ç–æ–≥–æ, —Ö—Ç–æ —Å–ø–æ–¥–æ–±–∞–≤—Å—è. –ü—ñ—Å–ª—è –∑–∞—Ö–æ–¥—É –≥—Ä–∞—î–º–æ ¬´–ú–∞—Ñ—ñ—é¬ª. –¢–∞–∫–∞ —ñ–≥—Ä–æ–≤–∞ —Ñ–æ—Ä–º–∞ –∫—Ä–∞—â–µ —Ä–æ–∑—Å–ª–∞–±–ª—è—î –ª—é–¥–µ–π —Ç–∞ –¥–æ–ø–æ–º–∞–≥–∞—î —Ä–æ–∑–∫—Ä–∏—Ç–∏—Å—è. –ö–∞—Ä—Ç–∏ —Å–∏–º–ø–∞—Ç—ñ–π —Ä–µ–∫–æ–º–µ–Ω–¥—É—é –∑–¥–∞–≤–∞—Ç–∏ –ø—ñ—Å–ª—è –≥—Ä–∏.</p>
		
