	<p>–î—É–º–∫–∞ –ø—Ä–æ –ª—é–¥–∏–Ω—É –Ω–∞—Å–ø—Ä–∞–≤–¥—ñ —Å–∫–ª–∞–¥–∞—î—Ç—å—Å—è –ø—Ä–∏–±–ª–∏–∑–Ω–æ –∑–∞ –∫—ñ–ª—å–∫–∞ —Å–µ–∫—É–Ω–¥. –¢–æ–º—É 7 —Ö–≤–∏–ª–∏–Ω –±—ñ–ª—å—à–µ, –Ω—ñ–∂ –¥–æ—Å—Ç–∞—Ç–Ω—å–æ, —â–æ–± –≤–∏–∑–Ω–∞—á–∏—Ç–∏—Å—è ‚Äî —Å–∏–º–ø–∞—Ç–∏—á–Ω–∞ –≤–∞–º –æ—Å–æ–±–∞, —â–æ —Å–∏–¥–∏—Ç—å –Ω–∞–≤–ø—Ä–æ—Ç–∏, —á–∏ –Ω—ñ. –ó–∞ —Ü–µ–π —á–∞—Å –º–æ–∂–Ω–∞ –æ—Ç—Ä–∏–º–∞—Ç–∏ –Ω–∞–≤—ñ—Ç—å –¥—É–∂–µ –¥–µ—Ç–∞–ª—å–Ω—É —ñ–Ω—Ñ–æ—Ä–º–∞—Ü—ñ—é. –î–æ —Ç–æ–≥–æ –∂ —è –ø–µ—Ä–µ–∫–æ–Ω–∞–Ω–∞: —è–∫—â–æ —ñ—Å–∫—Ä–∞ –Ω–µ —Å–ø–∞–ª–∞—Ö–Ω–µ –∑ —Å–∞–º–æ–≥–æ –ø–æ—á–∞—Ç–∫—É —Å–ø—ñ–ª–∫—É–≤–∞–Ω–Ω—è, –æ—Å–æ–±–∞ –≤–∞–º –Ω–µ —Ü—ñ–∫–∞–≤–∞ –Ω—ñ –∑–æ–≤–Ω—ñ—à–Ω—å–æ, –Ω—ñ –≤–Ω—É—Ç—Ä—ñ—à–Ω—å–æ, —Å—Ç–æ—Å—É–Ω–∫–∏ –Ω–µ —Å–∫–ª–∞–¥—É—Ç—å—Å—è.</p>
<p>–ù—ñ, —É —Ü—å–æ–º—É —î –ø–µ–≤–Ω–∞ —ñ–Ω—Ç—Ä–∏–≥–∞ –¥–ª—è —É—á–∞—Å–Ω–∏–∫—ñ–≤. –ú–∞—é —É –ø–ª–∞–Ω–∞—Ö –∑—Ä–æ–±–∏—Ç–∏ —Ç–∞–∫–∏–π –∑–∞—Ö—ñ–¥ –±—ñ–∑–Ω–µ—Å —Ñ–æ—Ä–º–∞—Ç—É, –¥–µ —Ü–µ –±—É–¥–µ –º–æ–∂–ª–∏–≤–æ —ñ –¥–µ –±—É–¥–µ —â–µ –∫—ñ–ª—å–∫–∞ –æ–ø—Ü—ñ–π. –ù–µ —Ö–æ—á—É –ø–æ–∫–∏ —Ä–æ–∑–∫—Ä–∏–≤–∞—Ç–∏ –≤—Å—ñ —Å–µ–∫—Ä–µ—Ç–∏. –í –ø–ª–∞–Ω–∞—Ö —Ç–∞–∫–æ–∂ —ñ–Ω—à—ñ –∑–∞—Ö–æ–¥–∏. –î–ª—è —Ü—å–æ–≥–æ —Ä–æ–±–ª—é —Ç–∞–∫ –∑–≤–∞–Ω—ñ –æ–ø–∏—Ç—É–≤–∞–Ω–Ω—è, —â–æ–± –±—ñ–ª—å—à–µ –∑–Ω–∞—Ç–∏ –ø—Ä–æ –∫–ª—ñ—î–Ω—Ç—ñ–≤ —Ç–∞ —ó—Ö–Ω—ñ –ø–æ—Ç—Ä–µ–±–∏. –®–≤–∏–¥–∫—ñ –ø–æ–±–∞—á–µ–Ω–Ω—è –≤—ñ–¥—Ä—ñ–∑–Ω—è—é—Ç—å—Å—è –≤—ñ–¥ —Å–∞–π—Ç—É –∑–Ω–∞–π–æ–º—Å—Ç–≤. –ù–∞—Å–ø—Ä–∞–≤–¥—ñ —Ç–∞–º –≤–∞–∂–∫–æ –∑–Ω–∞–π—Ç–∏ –ø–∞—Ä—É. –ü–æ–ø—Ä–∏ —Ç–µ, —â–æ –∫–æ–ª–æ –ª—é–¥–µ–π –≤–µ–ª–∏–∫–µ, –≤–∞—Ä—ñ–∞–Ω—Ç—ñ–≤ –Ω–µ —Ç–∞–∫ –≤–∂–µ –π –±–∞–≥–∞—Ç–æ. –ó–∞–∑–≤–∏—á–∞–π –ø–æ–ø–µ—Ä–µ–¥–∂–∞—é, —á–æ–≥–æ –Ω–µ –≤–∞—Ä—Ç–æ –≥–æ–≤–æ—Ä–∏—Ç–∏ ‚Äî —Ü–µ –ø—Ä–æ –∫–æ–ª–∏—à–Ω—ñ—Ö, –ø–æ–ª—ñ—Ç–∏–∫—É —Ç–∞ —Ä–µ–ª—ñ–≥—ñ—é.</p><a id='p2'></a><h3></h3><p>–¶–µ –Ω–µ —Ç–µ–º–∏ –¥–ª—è –ø–µ—Ä—à–∏—Ö –ø–æ–±–∞—á–µ–Ω—å. –ö–æ–≥–æ—Å—å —Ü—ñ –ø–∏—Ç–∞–Ω–Ω—è –Ω–∞—Å—Ç–æ—Ä–æ–∂—É—é—Ç—å, –∞ –¥–ª—è –∫–æ–≥–æ—Å—å —î –æ—Å–Ω–æ–≤–Ω–∏–º–∏ –∫—Ä–∏—Ç–µ—Ä—ñ—è–º–∏. –ö–æ–ª–∏ –ø—Ä–∏—Ö–æ–¥—è—Ç—å –¥—ñ–≤—á–∞—Ç–∞ —ñ —Ö–ª–æ–ø—Ü—ñ, –º–æ–∂–µ—Ç–µ –ø—Ä–æ—Ñ–µ—Å—ñ–π–Ω–∏–º –æ–∫–æ–º –ø–æ–±–∞—á–∏—Ç–∏, —è–∫–∞ –ø–∞—Ä–∞ –∑—ñ–π–¥–µ—Ç—å—Å—è? –Ü–Ω–æ–¥—ñ —Ü–µ –¥–æ–±—Ä–µ –≤–∏–¥–Ω–æ. –õ—é–¥–∏, —â–æ —Å–∏–º–ø–∞—Ç–∏–∑—É—é—Ç—å –æ–¥–Ω–µ –æ–¥–Ω–æ–º—É, –º–∞—é—Ç—å –æ—Å–æ–±–ª–∏–≤–∏–π –ø–æ–≥–ª—è–¥. –°–≤–æ—ó –ø–æ–±–∞—á–µ–Ω–Ω—è –∑–∞–≤–∂–¥–∏ –≤–ª–∞—à—Ç–æ–≤—É—é —É —Ü–µ–Ω—Ç—Ä—ñ –≤ –Ω–µ–¥—ñ–ª—é. –ü—ñ—Å–ª—è —Å–ø—ñ–ª–∫—É–≤–∞–Ω–Ω—è –≤–æ–Ω–∏ —É —Å–ø–µ—Ü—ñ–∞–ª—å–Ω—ñ–π –∞–Ω–∫–µ—Ç—ñ, —É –≥—Ä–∞—Ñ—ñ —Å–∏–º–ø–∞—Ç—ñ–π, –≤–∏—Å—Ç–∞–≤–ª—è—é—Ç—å –ø–ª—é—Å–∏–∫–∏ ‚Äî —Ö—Ç–æ —Å–ø–æ–¥–æ–±–∞–≤—Å—è. –ù–∞–º–∞–≥–∞—é—Å—å –æ–±—Ä–æ–±–∏—Ç–∏ —Ä–µ–∑—É–ª—å—Ç–∞—Ç–∏ –∑–∞ –ø—ñ–≤ –≥–æ–¥–∏–Ω–∏, —â–æ–± –≤ —Ä–∞–∑—ñ, —è–∫—â–æ –ø–∞—Ä–∞ –∑—ñ–π–¥–µ—Ç—å—Å—è, –ª—é–¥–∏ –¥–∞–ª–µ–∫–æ –Ω–µ —Ä–æ–∑—Ö–æ–¥–∏–ª–∏—Å—å —ñ –º–∞–ª–∏ –º–æ–∂–ª–∏–≤—ñ—Å—Ç—å —â–µ –ø–æ—Å–ø—ñ–ª–∫—É–≤–∞—Ç–∏—Å—å. –í —Ç–∞–∫–æ–º—É –≤–∏–ø–∞–¥–∫—É –¥–∞—é –∫–æ–Ω—Ç–∞–∫—Ç–∏ —ó–º –æ–¥–Ω–µ –æ–¥–Ω–æ–≥–æ.</p>
<p>–ù–µ –≤–∞—Ä—Ç–æ –≤—ñ–¥–∫–ª–∞–¥–∞—Ç–∏ –∑ —Ü–∏–º: –∫–æ–ª–∏ –ª—é–¥–∏ –æ–¥—Ä–∞–∑—É –∑—É—Å—Ç—Ä—ñ—á–∞—é—Ç—å—Å—è, –∑ —Ç–æ–≥–æ –º–æ–∂–µ —â–æ—Å—å –≤–∏–π—Ç–∏. –ë—É–≤–∞—î, —â–æ –º–æ—ó –∫–ª—ñ—î–Ω—Ç–∏ –ø—Ä–∏—Ö–æ–¥—è—Ç—å –¥–æ –º–µ–Ω–µ –Ω–∞ —Ç–∞–∫—ñ —à–≤–∏–¥–∫—ñ –ø–æ–±–∞—á–µ–Ω–Ω—è –ø–æ –∫—ñ–ª—å–∫–∞ —Ä–∞–∑—ñ–≤ —ñ –Ω–µ –º–æ–∂—É—Ç—å –Ω—ñ–∫–æ–≥–æ —Å–æ–±—ñ –∑–Ω–∞–π—Ç–∏. –ê –±—É–≤–∞–ª–æ, —â–æ —ñ –≤—ñ–Ω, —ñ –≤–æ–Ω–∞ –ø—Ä–∏–π—à–ª–∏ –ø–µ—Ä—à–∏–π —Ä–∞–∑, —ñ –æ–¥—Ä–∞–∑—É —É –Ω–∏—Ö —Å–∫–ª–∞–ª–∞—Å—è –ø–∞—Ä–∞. –Ø–∫—â–æ —Å–∏–º–ø–∞—Ç—ñ—è –ª–∏—à–µ –∑ –æ–¥–Ω—ñ—î—ó —Å—Ç–æ—Ä–æ–Ω–∏, —Ç–æ–¥—ñ, –Ω–∞ –∂–∞–ª—å, –Ω—ñ. –ö–∞—Ç–µ–≥–æ—Ä—ñ—è –ª—é–¥–µ–π, —è–∫—ñ –¥–æ –º–µ–Ω–µ –ø—Ä–∏—Ö–æ–¥—è—Ç—å, ‚Äî –ª—é–¥–∏, —è–∫—ñ –±–∞–≥–∞—Ç–æ –ø—Ä–∞—Ü—é—é—Ç—å.</p>
<p>–í–æ–Ω–∏ –Ω–µ –º–∞—é—Ç—å –º–æ–∂–ª–∏–≤–æ—Å—Ç—ñ –≤—ñ–¥–≤—ñ–¥—É–≤–∞—Ç–∏ –º–æ–ª–æ–¥—ñ–∂–Ω—ñ –∫–ª—É–±–∏, —ó–º –≤–∞–∂–∫–æ –∫—É–¥–∏—Å—å –≤–∏–±—Ä–∞—Ç–∏—Å—å, –±–æ —Ü–µ –¥–æ—Ä–æ–≥–æ—Ü—ñ–Ω–Ω–∏–π –¥–ª—è –Ω–∏—Ö —á–∞—Å.</p><strong><a id='p3'></a><h2>–õ–∏–º–∞–Ω | –ó–Ω–∞–π–æ–º—Å—Ç–≤–∞ üíó | –î–æ–Ω–µ—Ü—å–∫–∞ –æ–±–ª–∞—Å—Ç—å ‚Äî mistaUA</h2></strong><p>–ê –¥–æ –º–µ–Ω–µ —ó–º –æ–ø—Ç–∏–º–∞–ª—å–Ω–æ. –ú–æ—ó –∫–ª—ñ—î–Ω—Ç–∏ ‚Äî –∑–∞–π–Ω—è—Ç—ñ –ª—é–¥–∏, —è–∫—ñ –Ω–µ –º–∞—é—Ç—å —á–∞—Å—É –Ω–∞ –≤–ª–∞—à—Ç—É–≤–∞–Ω–Ω—è –æ—Å–æ–±–∏—Å—Ç–æ–≥–æ –∂–∏—Ç—Ç—è. –¶–∏–º –∑–∞–π–º–∞—é—Å—è —è. –ù–∞–ø–µ–≤–Ω–µ, –∑ –æ—Å–æ–±–ª–∏–≤—ñ—Å—Ç—é —Å—Ç–∞—Ç—ñ. –ß–æ–ª–æ–≤—ñ–∫–∏ –∑–∞–∫–æ—Ö—É—é—Ç—å—Å—è –æ—á–∏–º–∞. –í–ª—ñ—Ç–∫—É –¥–∏–≤–ª—è—Ç—å—Å—è –Ω–∞ –¥—ñ–≤—á–∞—Ç —É –∫–æ—Ä–æ—Ç–µ–Ω—å–∫–∏—Ö –ø–ª–∞—Ç—Ç—è—á–∫–∞—Ö, —Å–ø—ñ–¥–Ω–∏—Ü—è—Ö, —Ü–µ —Å–ø–æ–Ω—É–∫–∞—î —ó—Ö –∑–Ω–∞–π—Ç–∏ —Å–æ–±—ñ –ø–∞—Ä—É. –î—ñ–≤—á–∞—Ç–∞ –∂, –Ω–∞–≤–ø–∞–∫–∏, –±–ª–∏–∂—á–µ –¥–æ —Å–≤—è—Ç –≤—ñ–¥—á—É–≤–∞—é—Ç—å, —â–æ –Ω–µ —Ö–æ—á—É—Ç—å –±—É—Ç–∏ —Å–∞–º–æ—Ç–Ω—ñ–º–∏ —É —Ü—ñ –¥–Ω—ñ ‚Äî –ø—Ä–∞–≥–Ω—É—Ç—å —Ç–µ–ø–ª–∞, —É–≤–∞–≥–∏.</p>
		
			
				<div>—Ä–æ–ª–∏–∫ ¬´–ö–æ–∂–Ω–∞ –∫—Ä–∞–ø–ª–∏–Ω–∞ –º–∞—î –∑–Ω–∞—á–µ–Ω–Ω—è¬ª</div>
