	<p>–ù—ñ–∫–æ–ª–∏ –Ω–µ —Å–ª—ñ–¥ –¥—É–º–∞—Ç–∏, —â–æ –º–∏ –º–æ–∂–µ–º–æ –ª—é–¥–∏–Ω—É –∑–º—ñ–Ω–∏—Ç–∏. –Ø–∫—â–æ –≤–∏ –±–∞—á–∏—Ç–µ —è–∫–∏–π—Å—å –Ω–µ–¥–æ–ª—ñ–∫ —É —Å–≤–æ—î–º—É –ø–∞—Ä—Ç–Ω–µ—Ä–æ–≤—ñ, –≤–∞–º —Ç—Ä–µ–±–∞ –ø–æ–¥—É–º–∞—Ç–∏, —á–∏ –º–æ–∂–µ—Ç–µ –≤–∏ –∑ —Ü–∏–º –∂–∏—Ç–∏. –õ—é–¥–∏–Ω—É –≤–∏ –Ω–µ –∑–º—ñ–Ω–∏—Ç–µ. –ú–æ–∂–Ω–∞ –∑–º—ñ–Ω–∏—Ç–∏ –∞–±–æ —Å—Ç–∞–≤–ª–µ–Ω–Ω—è –¥–æ –ø–∞—Ä—Ç–Ω–µ—Ä–∞, –∞–±–æ —Å–∞–º–æ–≥–æ –ø–∞—Ä—Ç–Ω–µ—Ä–∞. –¢–∞–∫ —Å–∞–º–æ, —è–∫ –Ω–µ —Å–ª—ñ–¥ –¥—É–º–∞—Ç–∏, —â–æ –ø–æ–∂–∏–≤–µ–º–æ-–ø–æ–ª—é–±–∏–º–æ. –í—ñ–¥—á—É—Ç—Ç—è –º–µ–¥–æ–≤–æ–≥–æ –º—ñ—Å—è—Ü—è –ø—Ä–æ–π–¥–µ, –∞ –≤—Å–µ —Ç–µ, —â–æ –≤–∞—Å –¥—Ä–∞—Ç—É–≤–∞–ª–æ —É –ø–∞—Ä—Ç–Ω–µ—Ä—ñ, –∑–∞–ª–∏—à–∏—Ç—å—Å—è. –Ø–∫—â–æ –Ω–µ–º–∞—î –ª—é–±–æ–≤—ñ, –≤–∏—Ä—ñ—à—É–≤–∞—Ç–∏ –Ω–∞–≤—ñ—Ç—å –Ω–∞–π–º–µ–Ω—à—É –ø—Ä–æ–±–ª–µ–º—É —É —Å—Ç–æ—Å—É–Ω–∫–∞—Ö –±—É–¥–µ –≤–∞–∂–∫–æ.</p>
<p>–í—Å–µ –∑–∞–ª–µ–∂–∏—Ç—å –≤—ñ–¥ –ª—é–¥–∏–Ω–∏. –ö–æ–º—É—Å—å –ø—Ä–∏–Ω—Ü–∏–ø–æ–≤–æ, —â–æ–± —É –ø–∞—Ä—Ç–Ω–µ—Ä–∞ –Ω–µ –±—É–ª–æ –ø–æ–ø–µ—Ä–µ–¥–Ω—å–æ –¥—ñ—Ç–µ–π.</p><strong><a id='p4'></a><h2>–ó–Ω–∞–π–æ–º—Å—Ç–≤–∞ | –£–∫—Ä–∞—ó–Ω–∞</h2></strong><p>–î–ª—è –∫–æ–≥–æ—Å—å —Ü–µ –≤–∑–∞–≥–∞–ª—ñ –Ω–µ –º–∞—î –∑–Ω–∞—á–µ–Ω–Ω—è. –õ—é–¥–∏ —Ä—ñ–∑–Ω—ñ. –†–æ–∑–ª—É—á–µ–Ω–∏–π, –∑ —Å–∏–Ω–æ–º –±–∞—á–∏—Ç—å—Å—è –Ω–∞ –≤–∏—Ö—ñ–¥–Ω–∏—Ö. –£ –Ω–µ–¥—ñ–ª—é, –∫–æ–ª–∏ –æ—Ä–≥–∞–Ω—ñ–∑–æ–≤—É–≤–∞–ª–∞ —à–≤–∏–¥–∫—ñ –ø–æ–±–∞—á–µ–Ω–Ω—è, –ø—Ä–æ—Å—Ç–æ –Ω–µ –º–∞–≤ –¥–µ –¥—ñ—Ç–∏ –¥–∏—Ç–∏–Ω—É. –î–æ–º–æ–≤–∏–ª–∏—Å—å, —â–æ –ø—Ä–∏–π–¥—É—Ç—å —Ä–∞–∑–æ–º –Ω–∞ –ø–æ–±–∞—á–µ–Ω–Ω—è. –¢–∞–∫–∏—Ö —á–æ–ª–æ–≤—ñ–∫—ñ–≤ –ø–æ–≤–∞–∂–∞—é, —ñ –º–æ—ó –∫–ª—ñ—î–Ω—Ç–∫–∏ —Ç–∞–∫–æ–∂. –¶–µ –≥–æ–≤–æ—Ä–∏—Ç—å –ø—Ä–æ –≤—ñ–¥–ø–æ–≤—ñ–¥–∞–ª—å–Ω—ñ—Å—Ç—å.</p>
<p>–ß–∞—Å—Ç–æ –ø–∞—Ä—Ç–Ω–µ—Ä–∏, —â–æ —Ä–æ–∑—ñ—Ä–≤–∞–ª–∏ –≤—ñ–¥–Ω–æ—Å–∏–Ω–∏, –∫–æ—Ä–∏—Å—Ç—É—é—Ç—å—Å—è –ø–æ—Å–ª—É–≥–∞–º–∏ –ø—Å–∏—Ö–æ–ª–æ–≥–∞. –¶–µ –¥–æ–ø–æ–º–∞–≥–∞—î —Ä–æ–∑—ñ–±—Ä–∞—Ç–∏—Å—è –∑ –ø–æ–ø–µ—Ä–µ–¥–Ω—ñ–º–∏ —Å—Ç–æ—Å—É–Ω–∫–∞–º–∏, –∑—Ä–æ–∑—É–º—ñ—Ç–∏, —â–æ –Ω–µ —Ç–∞–∫, –∞–±–∏ –Ω–µ –ø–æ–≤—Ç–æ—Ä—é–≤–∞—Ç–∏ –ø–æ–º–∏–ª–æ–∫ —É –º–∞–π–±—É—Ç–Ω—å–æ–º—É. –ù–∞—Ä–µ—à—Ç—ñ –≤ –Ω–∞—à–æ–º—É —Å—É—Å–ø—ñ–ª—å—Å—Ç–≤—ñ –≤—ñ–¥–≤—ñ–¥–∏–Ω–∏ —Ü—å–æ–≥–æ —Å–ø–µ—Ü—ñ–∞–ª—ñ—Å—Ç–∞ –≤–∂–µ –Ω–µ –¥–∏–≤–∏–Ω–∞, –∞ –Ω–∞–≤—ñ—Ç—å –º–æ–¥–Ω–æ. –†–∞–Ω—ñ—à–µ –ª—é–¥–∏ –ø—ñ—Å–ª—è —Ä–æ–∑–ª—É—á–µ–Ω—å –Ω–∞–º–∞–≥–∞–ª–∏—Å—å –≤–∏—Ä—ñ—à—É–≤–∞—Ç–∏ —Ü–µ –ø–∏—Ç–∞–Ω–Ω—è —Å–∞–º–æ—Å—Ç—ñ–π–Ω–æ, –Ω–µ —Å–ø—Ä–∞–≤–ª—è–ª–∏—Å—è –∑ —Ü–∏–º, —Å—Ç–∞–≤–∞–ª–∏ –Ω–µ—â–∞—Å–Ω–∏–º–∏ —ñ —á–∞—Å—Ç–æ —Ä–æ–±–∏–ª–∏ –Ω–µ—â–∞—Å–Ω–∏–º–∏ —Ç–∏—Ö, —Ö—Ç–æ –ø–æ—Ä—É—á. –Ü–Ω–æ–¥—ñ —Ü–µ –π–¥–µ –≤—ñ–¥ –º–æ–¥–µ–ª—ñ —Å—Ç–æ—Å—É–Ω–∫—ñ–≤ –Ω–∞—à–∏—Ö –±–∞—Ç—å–∫—ñ–≤, –¥–µ —á–∞—Å—Ç–æ –∑–≤—É—á–∏—Ç—å: —Ç—Ä–µ–±–∞ —Ç–µ—Ä–ø—ñ—Ç–∏ –æ–¥–Ω–µ –æ–¥–Ω–æ–º—É. –¢–æ–º—É —É –Ω–∞—Å —á–∞—Å—Ç–æ –≤—ñ–¥–Ω–æ—Å–∏–Ω–∏ –∞—Å–æ—Ü—ñ—é—é—Ç—å—Å—è –∑ —Ç–µ—Ä–ø—ñ–Ω–Ω—è–º. –ê–ª–µ –≤ —Ü—å–æ–º—É –º–æ–º–µ–Ω—Ç—ñ –∫—Ä–∏—î—Ç—å—Å—è –Ω–∞–π–±—ñ–ª—å—à–µ –∑–ª–æ.</p>
<p>–•—Ç–æ—Å—å –¥–æ–∑–≤–æ–ª—è—î —Å–æ–±—ñ –±—ñ–ª—å—à–µ, –∞ —Ö—Ç–æ—Å—å –≥–æ—Ç–æ–≤–∏–π —Ç–µ—Ä–ø—ñ—Ç–∏ –¥–æ –∫—ñ–Ω—Ü—è –∂–∏—Ç—Ç—è, –Ω–µ —Ä–æ–∑—É–º—ñ—é—á–∏, —â–æ –º–æ–∂–µ –±—É—Ç–∏ —ñ–Ω–∞–∫—à–µ. –¶—ñ —Ä–∞–º–∫–∏ –∑–∞–≤–∞–∂–∞—é—Ç—å. –ü—Ä–æ—Å—Ç—ñ—à–µ –ø–æ—á–∞—Ç–∏ –Ω–æ–≤—ñ —Å—Ç–æ—Å—É–Ω–∫–∏. –ù–∞—Å–ø—Ä–∞–≤–¥—ñ –ø–æ—Ç—Ä—ñ–±–Ω–æ –ª—é–±–∏—Ç–∏, –ø–æ–≤–∞–∂–∞—Ç–∏ –æ–¥–Ω–µ –æ–¥–Ω–æ–≥–æ, —É –∫–æ–∂–Ω–æ–≥–æ –º–∞—î –±—É—Ç–∏ —Å–≤–æ—î –æ–∫—Ä–µ–º–µ –∑–∞–Ω—è—Ç—Ç—è. –ß–æ–ª–æ–≤—ñ–∫–∏ –∑–∞–≤–∂–¥–∏ –Ω–∞ –ø–µ—Ä—à–µ –º—ñ—Å—Ü–µ —Å—Ç–∞–≤–ª—è—Ç—å –¥–æ–≥–ª—è–Ω—É—Ç—ñ—Å—Ç—å –∂—ñ–Ω–∫–∏. –î—ñ–≤—á–∏–Ω–∞ —É —Å—É–∫–Ω—ñ, –Ω–∞ –ø—ñ–¥–±–æ—Ä–∞—Ö, –∑ –¥–æ–≥–ª—è–Ω—É—Ç–∏–º–∏ —Ä—É–∫–∞–º–∏, –æ–±–ª–∏—á—á—è–º —Ç–∞ –≤–æ–ª–æ—Å—Å—è–º –±—É–¥–µ –≤ –ø—Ä—ñ–æ—Ä–∏—Ç–µ—Ç—ñ.</p>
<p>–ü—Ä–∏–≤—ñ—Ç –¥–∞–≤–∞–π –ø–æ–∑–Ω–∞–π–æ–º–∏–º–æ—Å—å. –≤—á–µ—Ä–∞ –≤  –°–∞–Ω—è –ë–µ–ª—ã–π –∑–∞–ø–∏—Å—å –∑–∞–∫—Ä–µ–ø–ª–µ–Ω–∞ –≤—á–µ—Ä–∞ –≤  –ü–æ–∑–Ω–∞–∫–æ–º–ª—é—Å—å —Å –¥–µ–≤—É—à–∫–æ–π –ª–µ—Ç –¥–ª—è –¥—Ä—É–∂–±—ã. –ö–∞—Ä—ñ–Ω–∞ –§–µ—Ö—Ç–µ–ª –∑–∞–ø–∏—Å—å –∑–∞–∫—Ä–µ–ø–ª–µ–Ω–∞ 12 —Ñ–µ–≤ –≤  –£—Å—ñ–º –ø—Ä–∏–≤—ñ—Ç. –°–Ω–∞—á–∞–ª–∞ –Ω–æ–≤—ã–µ.</p><a id='p5'></a><h3></h3><p>–ü–µ–Ω–Ω–∏–≤–∞–π–∑ –ü–µ–Ω–Ω–∏–≤–∞–π–∑–æ–≤. —Å–µ–≥–æ–¥–Ω—è –≤  –î–∏–º–∞ –•–æ–±–ª–µ–Ω—é–∫. –ê–Ω–¥—Ä—ñ–π –ö–æ–ø–∞–Ω—Å—å–∫–∏–π –∑–∞–ø–∏—Å—å –∑–∞–∫—Ä–µ–ø–ª–µ–Ω–∞ 12 —Ñ–µ–≤ –≤  –®—É–∫–∞—é –ø–æ—à–ª—É –¥—ñ–≤—á–∏–Ω—É, –¥–ª—è —Å–ø—ñ–ª–∫—É–≤–∞–Ω–Ω—è –Ω–∞ —Ä—ñ–∑–Ω—ñ —Ü—ñ–∫–∞–≤—ñ —Ç–µ–º–∏. –ò–Ω–Ω–∞ –ö—É–Ω–¥–µ–Ω–∫–æ –∑–∞–ø–∏—Å—å –∑–∞–∫—Ä–µ–ø–ª–µ–Ω–∞ 12 —Ñ–µ–≤ –≤  –ü—Ä–∏–≤–µ—Ç –≥–æ –≤ –õ–°. –ó–Ω–∞–π–æ–º—Å—Ç–≤–∞ –£–∫—Ä–∞—ó–Ω–∞ –∑–∞–ø–∏—Å—å –∑–∞–∫—Ä–µ–ø–ª–µ–Ω–∞ 1 —Ñ–µ–≤ –≤  –õ—î–Ω–∞ –ë–æ—Ä–æ–≤–µ—Ü—å. –°–Ω–∞—á–∞–ª–∞ —Å—Ç–∞—Ä—ã–µ. –û–ª–µ–≥ –†—É–¥–µ–Ω–∫–æ. –î–æ–±—Ä–æ—ó –Ω–æ—á—ñ.</p><img src="http://sun9-51.userapi.com/s/v1/if1/9qf26t9xgWAMs8mATYG3LCM7RLs2mnjpfvJMrcknkMl49yfAe457J8RLLwfl4HCAcAJASHoT.jpg?size=200x0&quality=96&crop=0,0,402,604&ava=1" alt="" style="max-width: 480px; max-height: 480px;"/><p>–†–æ—Å—Ç–∏–∫ –ú–æ—Ç—Ä–∏—á–µ–Ω–∫–æ. –ò–≥–æ—Ä—å –ò–≥–æ—Ä—å.</p>
		
